snippet.description:
Aproveitei a quarentena pra passar 30 dias treinando em casa da maneira que eu achava que poderia funcionar, sem personal trainer, sem alteres, sem suplementação, só com força de vontade, para mostrar resultados reais e não iludir ninguém mostrando um shape impossível em um curto período de tempo. 

Deixe aqui qual o próximo treino que vc gostaria de ver eu testar:
Calistenia;
Musculação;
Pilates;
Powerlifting;
Treino de Famosos por 30 dias;

Me encontre em todas as redes sociais como "flaminodoug"

